casadi_int main_solver(casadi_int argc, char* argv[]) {
  casadi_int j;
  casadi_real* a;
  const casadi_real* r;
  casadi_int flag;
  casadi_int iw[7235];
  casadi_real w[64025];
  const casadi_real* arg[378];
  casadi_real* res[375];
  arg[0] = w+0;
  arg[1] = w+725;
  arg[2] = w+728;
  arg[3] = w+1453;
  arg[4] = w+2178;
  arg[5] = w+2900;
  arg[6] = w+3622;
  arg[7] = w+4347;
  res[0] = w+5069;
  res[1] = w+5794;
  res[2] = w+5795;
  res[3] = w+6517;
  res[4] = w+7242;
  res[5] = w+7964;
  a = w;
  for (j=0; j<5069; ++j) if (scanf("%lg", a++)<=0) return 2;
  flag = solver(arg, res, iw, w+7967, 0);
  if (flag) return flag;
  r = w+5069;
  for (j=0; j<2898; ++j) CASADI_PRINTF("%g ", *r++);
  CASADI_PRINTF("\n");
  return 0;
}


